  [],\n\t\"revision_timestamp\": \"2015-05-06T21:54:20.719223\",\n\t\"name\": \"novel-high-temperature-magnetic-bearings-for-space-vehicle-systems-project-20639\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Previous high temperature magnetic bearings
  employed electromagnets only. The work proposed in this SBIR program seeks to utilize
  High Temperature Permanent Magnets (HTPM) developed by EEC. This will improve efficiency
  since the majority of the static load on any bearing can be suspended by the magnetic
  field of the HTPM. rnrnThe end product will be a high speed/high temperature/high
  load test platform for the future development of bearing, motor, generator, and
  seal components.  This capability will be of special benefit to the aerospace and
  process machinery industries. In addition the component demonstrations from this
  SBIR will provide designers with the confidence needed to integrate similar components
  in their high performance machinery.\",\n\t\"license_title\": \"U.S. Government
